<?php

namespace tcCore\Console\Commands;

use Illuminate\Console\Command;
use Illuminate\Support\Facades\Auth;
use tcCore\Http\Helpers\ActingAsHelper;
use tcCore\MatrixQuestion;
use tcCore\Question;
use tcCore\User;
use Illuminate\Support\Facades\DB;

class CreateMatrixQuestion extends Command
{
    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = 'create_question:matrix {--user_id=} {--subject_id=} {--education_level_id=} {--test_id=}';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'Command description';

    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct()
    {
        parent::__construct();
    }

    /**
     * Execute the console command.
     *
     * @return int
     */
    public function handle()
    {
        $user = User::find($this->option('user_id'));
        ActingAsHelper::getInstance()->setUser($user);
        Auth::login($user);
        $props = [ 'subject_id' => $this->option('subject_id') ,
            'education_level_id' => $this->option('education_level_id'),
            'type' => 'MatrixQuestion',
            'question' => $this->getQuestionHtml(),
            'education_level_year' => 6,
            'score' => 1,
            'decimal_score' =>  0,
            'note_type' => 'NONE',
            'rtti' => null,
            'bloom' => null,
            'miller' => null,
            'add_to_database' => 1,
            'is_open_source_content' => 0,
            'metadata' => null,
            'external_id' => 'ITM-130087',
            'scope' => 'cito',
            'styling' => $this->getStyling(),
            'closeable' => 0,
            'html_specialchars_encoded' => 0,
            'is_subquestion' => 0,
            'all_or_nothing' => 0,
            'sub_type' => 'SingleChoice',
            'authors' => [$this->option('user_id')],
        ];
        $question = new MatrixQuestion();
        $question->fill($props);
        $question->save();
        $query = $this->getSubquestionsQuery($question->getKey());
        DB::statement($query);
        $query = $this->getMatrixAnswersQuery($question->getKey());
        DB::statement($query);
        $question->fresh();
        $first = true;
        $firstAnswer = $question->matrixQuestionAnswers->first();
        $question->matrixQuestionSubQuestions->each(function ($matrixQuestionSubQuestion) use ($first,$question,$firstAnswer){
            if($first){
                $answer = $firstAnswer;
            }else{
                $answer = $question->matrixQuestionAnswers->whereNot('id',$firstAnswer->getKey())->first();
            }
            $query = $this->getMatrixSubQuestionAnswersQuery($matrixQuestionSubQuestion->getKey(),$answer->getKey());
            DB::statement($query);
            $first = false;
        });
        $max = DB::table('test_questions')->where('test_id',$this->option('test_id'))->max('order');
        $order = $max++;
        $query = $this->getTestQuestionQuery($this->option('test_id'),$question->getKey(),$order);
        DB::statement($query);
    }

    private function getQuestionHtml()
    {
        return '<div class=\"content custom-qti-style\"><div class=\"qti-layout-row\"><div class=\"qti-layout-col12\"><div id=\"body\"><p><span>De kwaliteit van de productiefactor arbeid wordt gemeten door de arbeidsproductiviteit. De arbeidsproductiviteit kan worden verbeterd door een aantal factoren. </span></p></div><div id=\"question\"><p><strong><strong><strong><strong><strong><strong><span>Geef bij onderstaande factoren aan of ze wel of geen invloed hebben op de arbeidsproductiviteit.</span></strong></strong></strong></strong></strong></strong></p></div><div></div></div></div></div>';
    }

